import React from 'react';
import { Link } from 'react-router-dom';
import {SiDatadog} from 'react-icons/si';
import { Menu } from 'semantic-ui-react';
const Header = () => (

  <>
    <div id="header">
      <h1><SiDatadog/>Walker-Fetch</h1>
      <h2>Find your next dog walker today.</h2>
    </div>
    <div class="centered">
        <div class="centerd">
          <Menu secondary>
            <Link to="/"><Menu.Item name="home">Home </Menu.Item></Link>
            <Link to="/about"><Menu.Item name="about">About </Menu.Item></Link>
            <Link to="/contact"><Menu.Item name="contact">Contact </Menu.Item></Link>
          </Menu>
        </div>
    </div>
  </>


);

export default Header;
